import './App.css';
import homeforadmin from "./admin/home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <h1>Food Safety</h1>
        <Router>
          <Routes>
            <Route path="/admin" element={<homeforadmin/>} />
          </Routes>
        </Router>
    </div>
  );
}

export default App;
